        private static byte[] Readx(FileStream sxtream, int xlength, int cccur)
        {
            BinaryReader w33 = new BinaryReader(sxtream);
            w33.BaseStream.Seek(cccur, SeekOrigin.Begin);
            byte[] bytes2 = new byte[xlength];
